import {Outlet} from "react-router-dom";
import DashHeader from "./DashHeader";
import DashFooter from "./DashFooter";
const DashLayout = () => {
  return (
    <>
        <DashHeader />
        <div className= "dash-countainer">
            <Outlet  />
        </div> 
        <DashFooter />
    </>
  )
}

export default DashLayout
